//         "Abstract": "In the 1980s, plot units (Lehnert, 1981) were pro- posed as a knowledge structure for representing nar- rative stories and generating summaries. Plot units are fundamentally different from the story represen- tations that preceded them because they focus on the affect states of characters and the tensions between them as the driving force behind interesting and co- hesive stories. Plot units were used in narrative sum- marization studies, both in computer science and psychology (Lehnert et al, 1981), but previous com- putational models of plot units relied on tremendous amounts of manual knowledge engineering. The last few decades have seen tremendous ad- vances in NLP and the emergence of many resources that could be useful for plot unit analysis. So we em- barked on a project to see whether plot unit repre- sentations can be generated automatically using cur- rent NLP technology. We created a system called AESOP that uses a variety of resources to iden- tify words that correspond to positive, negative, and mental affect states. AESOP uses affect projection rules to map the affect states onto the characters in the story based on verb argument structure. Addi- tionally, affect states are inferred based on syntactic properties, and causal and cross-character links are created using simple heuristics. Affect states often arise from actions that produce good or bad states for the character that is acted upon. For example, ?the cat ate the mouse? pro- duces a negative state for the mouse because being eaten is bad. Similarly, ?the man fed the dog? pro- duces a positive state for the dog because being fed is generally good. Knowledge about the effects of actions (i.e., state changes) on patients is not readily available in existing semantic resources. We create a new type of lexicon consisting of patient polarity verbs (PPVs) that impart positive or negative states on their patients. These verbs reflect world knowl- edge about desirable/undesirabl