//         "Abstract": "For most of the world?s languages, the availability of translation is limited to two possibilities: high qual- ity at high cost, via professional translators, and low quality at low cost, via machine translation (MT). The spectrum between these two extremes is very poorly populated, and at any point on the spectrum the ready availability of translation is limited to only a small fraction of the world?s languages. There is, of course, a long history of technological assistance to transla- tors, improving cost effectiveness using translation memory (Laurian, 1984; Bowker and Barlow, 2004) or other interactive tools to assist translators (Esteban et al, 2004; Khadivi et al, 2006). And there is a recent and rapidly growing interest in crowdsourc- ing with non-professional translators, which can be remarkably effective (Munro, 2010). However, all these alternatives face a central availability bottle- neck: they require the participation of humans with bilingual expertise. In this paper, we report on a new exploration of the middle ground, taking advantage of a virtually unutilized resource: speakers of the source and tar- get language who are effectively monolingual, i.e. who each only know one of the two languages rel- evant for the translation task. The solution we are proposing has the potential to provide a more cost effective approach to translation in scenarios where machine translation would be considered acceptable to use, if only it were generally of high enough qual- ity. This would clearly exclude tasks like transla- tion of medical reports, business contracts, or literary works, where the validation of a qualified bilingual translator is absolutely necessary. However, it does include a great many real-world scenarios, such as following news reports in another country, reading in- ternational comments about a product, or generating a decent first draft translation of a Wikipedia page for Wikipedia editors to improve. The use of monolingual participants in a human- machine translation process is not entirely new. Callison-Burch et al (2004) pioneered the explo- ration of monolingual post-editing within the MT community, an approach extended more recently to provide richer information to the user by Albrecht et al. (2009) and Koehn (2009). There have also been at least two independently developed human-machine translation frameworks that employ an iterative pro- tocol involving monolinguals on both the source and target side. Morita and Ishida (2009) describe a sys- tem in which target and source language speakers perform editing of MT output to improve fluency and adequacy, respectively; they utilize source-side paraphrasing at a course grain level, although their ap- proach is limited to requests to paraphrase the entire sentence when the translation cannot be understood.",
