//         "Abstract": "Semi-supervised learning (SSL) is the use of small amounts of labeled data with relatively large amounts of unlabeled data to train predictors. In some cases, the labeled data can be sufficient to pro- vide reasonable accuracy on in-domain data, but per- formance on even closely related out-of-domain data may lag far behind. Annotating training data for all sub-domains of a varied domain such as all of Web text is impractical, giving impetus to the develop- ment of SSL techniques that can learn from unla- beled data to perform well across domains. The ear- liest SSL algorithm is self-training (Scudder, 1965), where one makes use of a previously trained model to annotate unlabeled data which is then used to re-train the model. While self-training is widely used and can yield good results in some applica- tions (Yarowsky, 1995), it has no theoretical guaran- tees except under certain stringent conditions, which rarely hold in practice(Haffari and Sarkar, 2007). Other SSL methods include co-training (Blum and Mitchell, 1998), transductive support vector ma- chines (SVMs) (Joachims, 1999), and graph-based SSL (Zhu et al, 2003). Several surveys cover a broad range of methods (Seeger, 2000; Zhu, 2005; Chapelle et al, 2007; Blitzer and Zhu, 2008). A ma- jority of SSL algorithms are computationally expen- sive; for example, solving a transductive SVM ex- actly is intractable. Thus we have a conflict between wanting to use SSL with large unlabeled data sets for best accuracy, but being unable to do so because of computational complexity. Some researchers at- tempted to resolve this conflict by resorting to ap- proximations (Collobert et al, 2006), but those lead to suboptimal results (Chapelle et al, 2007). Graph-based SSL algorithms (Zhu et al, 2003; Joachims, 2003; Corduneanu and Jaakkola, 2003; Belkin et al, 2005; Subramanya and Bilmes, 2009) are an important subclass of SSL techniques that have received much attention in the recent past, as they outperform other approaches and also scale eas- ily to large problems. Here one assumes that the data (both labeled and unlabeled) is represented by ver- tices in a graph. Graph edges link vertices that are likely to have the same label. Edge weights govern how strongly the labels of the nodes linked by the edge should agree. Most previous work in SSL has focused on un- structured classification problems, that is, problems with a relatively small set of atomic labels. There",
