//         "Abstract": "Outputs of standard automatic speech recognition (ASR) systems typically consist of utterances where important linguistic and structural information (e.g., true case, sentence boundaries, punctuation sym- bols, etc) is not available. Such information is cru- cial in improving the readability of the transcribed speech texts, and plays an important role when fur- ther processing is required, such as in part-of-speech (POS) tagging, parsing, information extraction, and machine translation. We focus on the punctuation prediction task in this work. Most previous punctuation prediction techniques, developed mostly by the speech process- ing community, exploit both lexical and prosodic cues. However, in order to fully exploit prosodic fea- tures such as pitch and pause duration, it is necessary to have access to the original raw speech waveforms. In some scenarios where further natural language processing (NLP) tasks on the transcribed speech texts become the main concern, speech prosody in- formation may not be readily available. For exam- ple, in the recent evaluation campaign of the Inter- national Workshop on Spoken Language Translation (IWSLT) (Paul, 2009), only manually transcribed or automatically recognized speech texts are provided but the original raw speech waveforms are not avail- able. In this paper, we tackle the task of predicting punctuation symbols from a standard text processing perspective, where only the speech texts are avail- able, without relying on additional prosodic fea- tures such as pitch and pause duration. Specifi- cally, we perform the punctuation prediction task on transcribed conversational speech texts, using the IWSLT corpus (Paul, 2009) as the evaluation data. Different from many other corpora such as broad- cast news corpora, a conversational speech corpus consists of dialogs where informal and short sen- tences frequently appear. In addition, due to the nature of conversation, it also contains more ques- tion sentences compared to other corpora. An ex- ample English utterance randomly selected from the IWSLT corpus, along with its punctuated and cased version, are shown below: you are quite welcome and by the way we may get other reservations so could you please call us as soon as you fix the date You are quite welcome . And by the way , we may get other reservations , so could you please call us as soon as you fix the date ?",
