//         "Abstract": "There is a typical class of sequence labeling tasks in many natural language processing (NLP) applica- tions, which require solving a cascade of segmenta- tion and tagging subtasks. For example, many Asian languages such as Japanese and Chinese which do not contain explicitly marked word boundaries, word segmentation is the preliminary step for solv- ing part-of-speech (POS) tagging problem. Sen- tences are firstly segmented into words, then each word is assigned with a part-of-speech tag. Both syntactic parsing and dependency parsing usually start with a textual input that is tokenized, and POS tagged. The most commonly approach solves cascaded subtasks in a pipeline, which is very simple to im- plement and allows for a modular approach. While, the key disadvantage of such method is that er- rors propagate between stages, significantly affect- ing the quality of the final results. To cope with this problem, Shi and Wang (2007) proposed a rerank- ing framework in which N-best segment candidates generated in the first stage are passed to the tag- ging model, and the final output is the one with the highest overall segmentation and tagging probabil- ity score. The main drawback of this method is that the interaction between tagging and segmentation is restricted by the number of candidate segmentation outputs. Razvan C. Bunescu (2008) presented an improved pipeline model in which upstream subtask outputs are regarded as hidden variables, together with their probabilities are used as probabilistic fea- tures in the downstream subtasks. One shortcom- ing of this method is that calculation of marginal probabilities of features may be inefficient and some approximations are required for fast computation. Another disadvantage of these two methods is that they employ separate training and the segmentation model could not take advantages of tagging infor- mation in the training procedure. On the other hand, joint learning and decoding using cross-product of segmentation states and tag- ging states does not suffer from error propagation problem and achieves higher accuracy on both sub- tasks (Ng and Low, 2004). However, two problems arises due to the large state space, one is that the amount of parameters increases rapidly, which is apt to overfit on the training corpus, the other is that the inference by dynamic programming could be in- efficient. Sutton (2004) proposed Dynamic Con- ditional Random Fields (DCRFs) to perform joint training/decoding of subtasks using much fewer pa- rameters than the cross-product approach. How-",
