//         "Abstract": "The function of syntax is to combine words to ex- press meanings, using syntactic devices such as word order, auxiliary words, and morphology (Gold- berg, 1995). Virtually all natural language devices used for expressing meanings (e.g., words) exhibit polysemy. Like words, concrete syntactic forms (the sentence words generated by specific syntactic de- vices) can have several meanings. Consider the fol- lowing sentences: (a) They are playing chess in the park. (b) They are playing chess next Tuesday. Both contain the concrete syntactic form ?are play- ing?, generated by the abstract syntactic form usu- ally known as ?present progressive? (am/is/are + V- ing). In (a), the meaning is ?something happening now?, while in (b) it is ?a plan to do something in the future?. Note that the polysemy is of the syntactic form as a unit, not of individual words. In particu- lar, the verb ?play? is used in the same sense in both cases. In this paper we address a prominent type of syn- tactic form polysemy: the multiple possible senses that tense syntactic forms can have. Disambiguat- ing the polysemy of tense forms is of theoretical and practical importance (Section 2). To make our discussion concrete, we introduce the task of Tense Sense Disambiguation (TSD): given a concrete tense syntactic form in a sentence, select its correct sense among a given set of possible senses (Section 3). The disambiguation of polysemy is a fundamental problem in NLP. For example, Word Sense Disam- biguation (WSD) continues to attract a large number of researchers (Agirre and Edmonds, 2006). TSD has the same structure as WSD, with different dis- ambiguated entities. For experimenting with the TSD task, we com- piled an English syntactic sense dictionary based on a thorough study of three major English gram- mar projects (Section 4). We selected 3000 sen- tences from the British National Corpus containing 4702 concrete syntactic forms, and annotated each of these by its sense (Section 5).We developed a su- pervised learning TSD algorithm that uses various feature types and takes advantage of the task struc- ture (Section 6). Our algorithm substantially outper- 325 forms the ?most frequent sense? baseline (Section 7). TSD is fundamental to sentence understanding and thus to NLP applications such as textual infer- ence, question answering and information retrieval. To the best of our knowledge, this is the first paper to address this task. In Section 8 we discuss research directions relevant to TSD placing the new task in the context of the previous research of syntactic am- biguity resolution.",
