//         "Abstract": "With the ever increasing popularity of emails and web technologies, it is very common for people to discuss issues, events, agendas or tasks by email. Effective processing of the email contents can be of great strategic value. In this paper, we study the problem of topic segmentation for emails, i.e., grouping the sentences of an email thread into a set of coherent topical clusters. Adapting the stan- dard definition of topic (Galley et al, 2003) to con- versations/emails, we consider a topic is something about which the participant(s) discuss or argue or express their opinions. For example, in the email thread shown in Figure 1, according to the major- ity of our annotators, participants discuss three top- ics (e.g., ?telecon cancellation?, ?TAG document?, and ?responding to I18N?). Multiple topics seem to occur naturally in social interactions, whether syn- chronous (e.g., chats, meetings) or asynchronous (e.g., emails, blogs) conversations. In multi-party chat (Elsner and Charniak, 2008) report an average of 2.75 discussions active at a time. In our email cor- pus, we found an average of 2.5 topics per thread. Topic segmentation is often considered a pre- requisite for other higher-level conversation analy- sis and applications of the extracted structure are broad, encompassing: summarization (Harabagiu and Lacatusu, 2005), information extraction and or- dering (Allan, 2002), information retrieval (Dias et al., 2007), and intelligent user interfaces (Dredze et al., 2008). While extensive research has been con- ducted in topic segmentation for monologues (e.g., (Malioutov and Barzilay, 2006), (Choi et al, 2001)) and synchronous dialogs (e.g., (Galley et al, 2003), (Hsueh et al, 2006)), none has studied the problem of segmenting asynchronous multi-party conversa- tions (e.g., email). Therefore, there is no reliable an- notation scheme, no standard corpus, and no agreed- upon metrics available. Also, it is our key hypothe- sis that, because of its asynchronous nature, and the use of quotation (Crystal, 2001), topics in an email thread often do not change in a sequential way. As a result, we do not expect models which have proved successful in monologue or dialog to be as effective when they are applied to email conversations. Our contributions in this paper aim to remedy 388 these problems. First, we present an email corpus annotated with topics and evaluate annotator agree- ment. Second, we adopt a set of metrics to mea- sure the local and global structural similarity be- tween two annotations from the work on multi-party chat disentanglement (Elsner and Charniak, 2008). Third, we show how the two state-of-the-art topic segmentation methods (i.e., LCSeg and LDA) which are solely based on lexical information and make strong assumptions on the resulting topic models, can be effectively applied to emails, by having them to consider, in a principled way, a finer level struc- ture of the underlying conversations. Experimen- tal results show that both LCSeg and LDA benefit when they are extended to consider the conversa- tional structure. When comparing the two methods, we found that LCSeg is better than LDA and this advantage is preserved when they are extended to incorporate conversational structure.",
