//         "Abstract": "Language is about successful communication be- tween a speaker and a listener. For example, if the goal is to reference the target object O1 in Figure 1, a speaker might choose one of the following two ut- terances: (a) right of O2 (b) on O3 Although both utterances are semantically correct, (a) is ambiguous between O1 and O3, whereas (b) unambiguously identifies O1 as the target object, and should therefore be preferred over (a). In this paper, we present a game-theoretic model that cap- tures this communication-oriented aspect of lan- guage interpretation and generation. Successful communication can be broken down into semantics and pragmatics. Most computational Figure 1: An example of a 3D model of a room. The speaker?s goal is to reference the target object O1 by de- scribing its spatial relationship to other object(s). The listener?s goal is to guess the object given the speaker?s description. work on interpreting language focuses on compo- sitional semantics (Zettlemoyer and Collins, 2005; Wong and Mooney, 2007; Piantadosi et al, 2008), which is concerned with verifying the truth of a sen- tence. However, what is missing from this truth- oriented view is the pragmatic aspect of language? that language is used to accomplish an end goal, as exemplified by speech acts (Austin, 1962). Indeed, although both utterances (a) and (b) are semantically valid, only (b) is pragmatically felicitous: (a) is am- biguous and therefore violates the Gricean maxim of manner (Grice, 1975). To capture this maxim, we develop a model of pragmatics based on game the- ory, in the spirit of Ja?ger (2008) but extended to the stochastic setting. We show that Gricean maxims 410 fall out naturally as consequences of the model. An effective way to empirically explore the prag- matic aspects of language is to work in the grounded setting, where the basic idea is to map language to some representation of the non-linguistic world (Yu and Ballard, 2004; Feldman and Narayanan, 2004; Fleischman and Roy, 2007; Chen and Mooney,",
