//         "Abstract": "In recent years, statistical MT systems have been easy to develop due to the rapid explosion in data availability, especially parallel data. However, in reality there are still many language pairs which lack parallel data, such as Urdu?English, Chinese? Italian, where large amounts of speakers exist for both languages; of course, the problem is far worse for pairs such as Catalan?Irish. For such resource- limited language pairs, sparse amounts of parallel data would cause the word alignment to be inac- curate, which would in turn lead to an inaccurate phrase alignment, and bad translations would re- sult. Callison-Burch et al (2006) argue that lim- ited amounts of parallel training data can lead to the problem of low coverage in that many phrases en- countered at run-time are not observed in the train- ing data and so their translations will not be learned. Thus, in recent years, research on addressing the problem of unknown words or phrases has become more and more evident for resource-limited lan- guage pairs. Callison-Burch et al (2006) proposed a novel method which substitutes a paraphrase for an un- known source word or phrase in the input sentence, and then proceeds to use the translation of that para- phrase in the production of the target-language re- sult. Their experiments showed that by translating paraphrases a marked improvement was achieved in coverage and translation quality, especially in the case of unknown words which previously had been left untranslated. However, on a large-scale data set, they did not achieve improvements in terms of auto- matic evaluation. Nakov (2008) proposed another way to use para- phrases in SMT. He generates nearly-equivalent syn- tactic paraphrases of the source-side training sen- tences, then pairs each paraphrased sentence with the target translation associated with the original sentence in the training data. Essentially, this method generates new training data using para- phrases to train a new model and obtain more useful 420 phrase pairs. However, he reported that this method results in bad system performance. By contrast, real improvements can be achieved by merging the phrase tables of the paraphrase model and the orig- inal model, giving priority to the latter. Schroeder et al (2009) presented the use of word lattices for multi-source translation, in which the multiple source input texts are compiled into a compact lat- tice, over which a single decoding pass is then per- formed. This lattice-based method achieved positive results across all data conditions. In this paper, we propose a novel method us- ing paraphrases to facilitate translation, especially for resource-limited languages. Our method does not distinguish unknown words in the input sen- tence, but uses paraphrases of all possible words and phrases in the source input sentence to build a source-side lattice to provide a diverse and flexible list of source-side candidates to the SMT decoder so that it can search for a best path and deliver the translation with the highest probability. In this case, we neither need to change the phrase table, nor add new features in the log-linear model, nor add new sentences in the training data. The remainder of this paper is organised as fol- lows. In Section 2, we define the ?translation diffi- culty? from the perspective of the source side, and then examine how well the test set is covered by the phrase table and the parallel training data . Sec- tion 3 describes our paraphrase lattice method and discusses how to set the weights for the edges in the lattice network. In Section 4, we report comparative experiments conducted on small, medium and large- scale English-to-Chinese data sets. In Section 5, we analyse the influence of our paraphrase lattice method. Section 6 concludes and gives avenues for future work.",
