//         "Abstract": "Entity translation aims at mapping the entity names (e.g., people, locations, and organizations) in source language into their corresponding names in target language. While high quality entity translation is es- sential in cross-lingual information access and trans- ?This work was done when the first two authors visited Mi- crosoft Research Asia. lation, it is non-trivial to achieve, due to the chal- lenge that entity translation, though typically bear- ing pronunciation similarity, can also be arbitrary, e.g., Jackie Chan and ?\u0019 (pronounced Cheng Long). Existing efforts to address these challenges can be categorized into transliteration- and corpus- based approaches. Transliteration-based approaches (Wan and Verspoor, 1998; Knight and Graehl, 1998) identify translations based on pronunciation similar- ity, while corpus-based approaches mine bilingual co-occurrences of translation pairs obtained from parallel (Kupiec, 1993; Feng et al, 2004) or compa- rable (Fung and Yee, 1998) corpora, or alternatively mined from bilingual sentences (Lin et al, 2008; Jiang et al, 2009). These two approaches have com- plementary strength? transliteration-based similar- ity can be computed for any name pair but cannot mine translations of little (or none) phonetic simi- larity. Corpus-based similarity can support arbitrary translations, but require highly scarce resources of bilingual co-occurrences, obtained from parallel or comparable bilingual corpora. In this paper, we propose a holistic approach, leveraging both transliteration- and corpus-based similarity. Our key contribution is to replace the use of scarce resources of bilingual co-occurrences with the use of untapped and significantly larger resources of monolingual co-occurrences for trans- lation. In particular, we extract monolingual co- occurrences of entities from English and Chinese Web corpora, which are readily available from en- tity search engines such as PeopleEntityCube1, de- ployed by Microsoft Research Asia. Such engine",
