//         "Abstract": "Domain adaptation is a common concern when op- timizing empirical NLP applications. Even when there is training data available in the domain of inter- est, there is often additional data from other domains that could in principle be used to improve perfor- mance. Realizing gains in practice can be challeng- ing, however, particularly when the target domain is distant from the background data. For developers of Statistical Machine Translation (SMT) systems, an additional complication is the heterogeneous na- ture of SMT components (word-alignment model, language model, translation model, etc.), which pre- cludes a single universal approach to adaptation. In this paper we study the problem of us- ing a parallel corpus from a background domain (OUT) to improve performance on a target do- main (IN) for which a smaller amount of parallel training material?though adequate for reasonable performance?is also available. This is a standard adaptation problem for SMT. It is difficult when IN and OUT are dissimilar, as they are in the cases we study. For simplicity, we assume that OUT is ho- mogeneous. The techniques we develop can be ex- tended in a relatively straightforward manner to the more general case when OUT consists of multiple sub-domains. There is a fairly large body of work on SMT adaptation. We introduce several new ideas. First, we aim to explicitly characterize examples from OUT as belonging to general language or not. Pre- vious approaches have tried to find examples that are similar to the target domain. This is less ef- fective in our setting, where IN and OUT are dis- parate. The idea of distinguishing between general and domain-specific examples is due to Daume? and Marcu (2006), who used a maximum-entropy model with latent variables to capture the degree of speci- ficity. Daume? (2007) applies a related idea in a simpler way, by splitting features into general and domain-specific versions. This highly effective ap- proach is not directly applicable to the multinomial models used for core SMT components, which have no natural method for combining split features, so we rely on an instance-weighting approach (Jiang and Zhai, 2007) to downweight domain-specific ex- amples in OUT. Within this framework, we use fea- tures intended to capture degree of generality, in- cluding the output from an SVM classifier that uses the intersection between IN and OUT as positive ex- amples. Our second contribution is to apply instance 451 weighting at the level of phrase pairs. Sentence pairs are the natural instances for SMT, but sen- tences often contain a mix of domain-specific and general language. For instance, the sentence Sim- ilar improvements in haemoglobin levels were re- ported in the scientific literature for other epoetins would likely be considered domain-specific despite the presence of general phrases like were reported in. Phrase-level granularity distinguishes our work from previous work by Matsoukas et al(2009), who weight sentences according to sub-corpus and genre membership. Finally, we make some improvements to baseline approaches. We train linear mixture models for con- ditional phrase pair probabilities over IN and OUT so as to maximize the likelihood of an empirical joint phrase-pair distribution extracted from a de- velopment set. This is a simple and effective alter- native to setting weights discriminatively to maxi- mize a metric such as BLEU. A similar maximum- likelihood approach was used by Foster and Kuhn (2007), but for language models only. For compar- ison to information-retrieval inspired baselines, eg (Lu? et al, 2007), we select sentences from OUT using language model perplexities from IN. This is a straightforward technique that is arguably bet- ter suited to the adaptation task than the standard method of treating representative IN sentences as queries, then pooling the match results. The paper is structured as follows. Section 2 de- scribes our baseline techniques for SMT adaptation, and section 3 describes the instance-weighting ap- proach. Experiments are presented in section 4. Sec- tion 5 covers relevant previous work on SMT adap- tation, and section 6 concludes.",
