//         "Abstract": "Can we do IR-like tasks without ASR? Information retrieval (IR) typically makes use of simple features that count terms within/across documents such as term frequency (tf) and inverse document frequency (IDF). Crucially, to compute these features, it is suf- ficient to count repetitions of a term. In particular, for many IR-like tasks, there is no need for an au- tomatic speech recognition (ASR) system to label terms with phonemes and/or words. This paper builds on Jansen et al (2010), a method for discovering terms with zero resources. This approach identifies long, faithfully repeated patterns in the acoustic signal. These acoustic repe- titions often correspond to terms useful for informa- tion retrieval tasks. Critically, this method does not require a phonetically interpretable acoustic model or knowledge of the target language. By analyzing a large untranscribed corpus of speech, this discovery procedure identifies a vast number of repeated regions that are subsequently grouped using a simple graph-based clustering method. We call the resulting groups pseudo-terms since they typically represent a single word or phrase spoken at multiple points throughout the corpus. Each pseudo-term takes the place of a word or phrase in bag of terms vector space model of a text document, allowing us to apply standard NLP algo- rithms. We show that despite the fully automated and noisy method by which the pseudo-terms are created, we can still successfully apply NLP algo- rithms with performance approaching that achieved with the gold standard manual transcription. Natural language processing tools can play a key role in understanding text document collections. Given a large collection of text, NLP tools can clas- sify documents by category (classification) and or- ganize documents into similar groups for a high level view of the collection (clustering). For exam- ple, given a collection of news articles, these tools can be applied so that the user can quickly see the topics covered in the news articles, and organize the collection to find all articles on a given topic. These tools require little or no human input (annotation) and work across languages. Given a large collection of speech, we would like 460 tools that perform many of the same tasks, allow- ing the user to understand the contents of the col- lection while listening to only small portions of the audio. Previous work has applied these NLP tools to speech corpora with similar results (see Hazen et al (2007) and the references therein.) However, unlike text, which requires little or no preprocess- ing, audio files are typically first transcribed into text before applying standard NLP tools. Automatic speech recognition (ASR) solutions, such as large vocabulary continuous speech recognition (LVCSR) systems, can produce an automatic transcript from speech, but they require significant development ef- forts and training resources, typically hundreds of hours of manually transcribed speech. Moreover, the terms that may be most distinctive in particular spoken documents often lie outside the predefined vocabulary of an off-the-shelf LVCSR system. This means that unlike with text, where many tools can be applied to new languages and domains with minimal effort, the equivalent tools for speech corpora often require a significant investment. This greatly raises the entry threshold for constructing even a minimal tool set for speech corpora analysis. The paper proceeds as follows. After a review of related work, we describe Jansen et al (2010), a method for finding repetitions in speech. We then explain how these repetitions are grouped into pseudo-terms. Document clustering and classifica- tion work surprisingly well on pseudo-terms; perfor- mance on a Switchboard task approaches a baseline based on gold standard manual transcriptions.",
