//         "Abstract": "Recent work on coreference resolution has shown that a rich feature space that models lexical, syn- tactic, semantic, and discourse phenomena is cru- cial to successfully address the task (Bengston and Roth, 2008; Haghighi and Klein, 2009; Haghighi and Klein, 2010). When such a rich representation is available, even a simple deterministic model can achieve state-of-the-art performance (Haghighi and Klein, 2009). By and large most approaches decide if two men- tions are coreferent using a single function over all these features and information local to the two men- tions.1 This is problematic for two reasons: (1) lower precision features may overwhelm the smaller number of high precision ones, and (2) local infor- mation is often insufficient to make an informed de- cision. Consider this example: The second attack occurred after some rocket firings aimed, apparently, toward [the israelis], apparently in retaliation. [we]?re checking our facts on that one. ... the president, quoted by ari fleischer, his spokesman, is saying he?s concerned the strike will undermine efforts by palestinian authorities to bring an end to terrorist at- tacks and does not contribute to the security of [israel]. Most state-of-the-art models will incorrectly link we to the israelis because of their proximity and compatibility of attributes (both we and the israelis are plural). In contrast, a more cautious approach is to first cluster the israelis with israel because the de- monymy relation is highly precise. This initial clus- tering step will assign the correct animacy attribute (inanimate) to the corresponding geo-political entity, which will prevent the incorrect merging with the mention we (animate) in later steps. We propose an unsupervised sieve-like approach to coreference resolution that addresses these is-",
