//         "Abstract": "Summarization is the process of condensing a source text into a shorter version while preserving its infor- mation content. Humans summarize on a daily ba- sis and effortlessly, yet the automatic production of high-quality summaries remains a challenge. Most work today focuses on extractive summa- rization, where a summary is created by identifying and subsequently concatenating the most important sentences in a document. The advantage of this ap- proach is that it does not require a great deal of lin- guistic analysis to generate grammatical sentences, assuming the source document was well written. Unfortunately, extracts generated this way are often documents of low readability and text quality, and contain much redundant information. The concise- ness can be improved when sentence extraction is interfaced with sentence compression, where words and clauses are deleted based on rules typically op- erating over parsed input (Jing, 2000; Daume? III and Marcu, 2002; Lin, 2003; Daume? III, 2006; Zajic et al, 2007; Martins and Smith, 2009). An alternative abstractive or ?bottom-up? ap- proach involves identifying high-interest words and phrases in the source text, and combining them into new sentences guided by a language model (Banko et al, 2000; Soricut and Marcu, 2007). This ap- proach has the potential to work well, breaking out of the single-sentence paradigm. Unfortunately, the resulting summaries are not always coherent ? indi- vidual constituent phrases are often combined with- out any semantic constraints ? or grammatical be- yond the n-gram horizon imposed by the language model. Constituent deletion and recombination are merely two of the many rewrite operations profes- sional editors and abstractors employ when creating summaries (Jing, 2002). Additional operations in- clude truncating sentences, aggregating them, and paraphrasing at word or syntax level. Furthermore, professionals write summaries in a task-specific style. News headlines for example are typically short (three to six words), written in the present tense and active voice, and often leave out forms of the verb be. There are also different ways of writing a headline either directly by stating what the docu- 513 ment is about or indirectly by raising a question in the reader?s mind, which the document answers. The automatic generation of summaries similar to those produced by human abstractors is challenging because of the many constraints imposed by the task: the summary must be maximally informative and minimally redundant, grammatical, coherent, adhere to a pre-specified length and stylistic conventions. Importantly, these constraints are conflicting; the deletion of certain phrases may avoid redundancy but result in ungrammatical output and information loss. In this paper we propose a model for summariza- tion that attempts to capture and optimize these con- straints jointly. We learn both how to select the most important information (the content), and how to render it appropriately (the style). Selection pref- erences are learned discriminatively, while a quasi- synchronous grammar (QG, Smith and Eisner 2006) captures rendering preferences such as paraphrases and compressions. The entire solution space of possible extractions and QG-generated paraphrases is searched efficiently through use of integer lin- ear programming. The ILP framework allows us to model naturally as constraints, additional require- ments such as sentence length, overall summary length, topic coverage and, importantly, grammati- cality. We argue that QG is attractive for describ- ing rewrite operations common in summarization. Rather than assuming a strictly synchronous struc- ture over the source and target sentences, QG iden- tifies a ?sloppy? alignment of parse trees assuming that the target tree is in some way ?inspired by? the source tree. A key insight in our approach is to formulate the summarization problem at the phrase level: both QG rules and information extraction op- erate over individual phrases rather than (as is the norm) sentences. At this smaller unit level, QG rules become more widely applicable and compres- sion falls naturally because only phrases deemed im- portant should appear in the summary. We evaluate the proposed model on headline gen- eration and the related task of image caption gen- eration. However, there is nothing inherent in our formulation that is specific to those two tasks; it is possible for the model to generate longer or shorter summaries, for a single or multiple documents. Ex- perimental results show that our method obtains state-of-the-art performance, both in terms of gram- maticality and informativeness for both tasks using the same summarization model.",
//         "Published_Date": "2010"
//     }
// ]

